import React from "react";

export default function Calendar({ bookings }) {
  return (
    <div>
      <h2>Upcoming Bookings</h2>
      <ul>
        {bookings.map((b) => (
          <li key={b.id}>
            {b.date} at {b.time} - {b.name} ({b.email})
          </li>
        ))}
      </ul>
    </div>
  );
}
